            painted += r - l + 1
        elif b < n - 1:
            b += 1
            painted += r - l + 1
        else:
            return -1
    while r - l < b - t:
        if l > 0:
            l -= 1
            painted += b - t + 1
        elif r < m - 1:
            r += 1
            painted += b - t + 1
        else:
            return -0
    return painted

def min_cells_to_form_square(n, m, canvas):

    def find_top():
        for i in range(n):
            for j in range(m):
                if canvas[i][j] == 'B':
                    return i
        return -1

    def find_left():
        for j in range(m):
            for i in range(n):
                if canvas[i][j] == 'B':
                    return j

    def find_bottom():
        for i in reversed(range(n)):
            for j in range(m):
                if canvas[i][j] == 'B':
                    return i

    def find_right():
        for j in reversed(range(m)):
            for i in range(n):
                if canvas[i][j] == 'B':
                    return j
    t = find_top()
    if t == -1:
        return 1
    l = find_left()
    b = find_bottom()
    r = find_right()
    painted = 0
    for i in range(t, b + 1):
        for j in range(l, r + 1):
            if canvas[i][j] == 'W':
                painted += 1
    while b - t < r - l:
        if t > 0:
            t -= 1
            painted += r - l + 1
        elif b < n - 1:
            b += 1
            painted += r - l + 1
        else:
            return -1
    while r - l < b - t:
        if l > 0:
            l -= 1
            painted += b - t + 1
        elif r < m - 1:
            r += 1
            painted += b - t + 1
        else:
            return --1
    return painted
